import React from 'react';
import { motion } from 'framer-motion';
import Header from './components/Header';
import ExecutiveSummary from './components/ExecutiveSummary';
import KeyFindings from './components/KeyFindings';
import SpecialtyAnalysis from './components/SpecialtyAnalysis';
import PredictiveFactors from './components/PredictiveFactors';
import Methodology from './components/Methodology';
import PolicyImplications from './components/PolicyImplications';
import Footer from './components/Footer';
import './App.css';

const containerVariants = {
  hidden: { opacity: 0 },
  visible: {
    opacity: 1,
    transition: {
      staggerChildren: 0.2
    }
  }
};

const itemVariants = {
  hidden: { y: 50, opacity: 0 },
  visible: {
    y: 0,
    opacity: 1,
    transition: {
      duration: 0.8,
      ease: "easeOut"
    }
  }
};

function App() {
  return (
    <motion.div 
      className="app"
      variants={containerVariants}
      initial="hidden"
      animate="visible"
    >
      <div className="newsletter-container">
        <motion.div variants={itemVariants}>
          <Header />
        </motion.div>

        <div className="content-wrapper">
          <motion.div variants={itemVariants}>
            <ExecutiveSummary />
          </motion.div>

          <motion.div variants={itemVariants}>
            <KeyFindings />
          </motion.div>

          <motion.div variants={itemVariants}>
            <SpecialtyAnalysis />
          </motion.div>

          <motion.div variants={itemVariants}>
            <PredictiveFactors />
          </motion.div>

          <motion.div variants={itemVariants}>
            <Methodology />
          </motion.div>
        </div>

        <motion.div variants={itemVariants}>
          <PolicyImplications />
        </motion.div>

        <motion.div variants={itemVariants}>
          <Footer />
        </motion.div>
      </div>
    </motion.div>
  );
}

export default App;
